    { $unwind: "$DEVICES" },
    { $match: { "DEVICES.DESCRIPTION": "Home nebulizer (physical object)" } },
    { $project: { _id: 0, udi: "$DEVICES.UDI" } }
])

db.patients.aggregate([
    { $match: { "OBSERVATIONS.DESCRIPTION": "Body mass index (BMI)" } },
    { $unwind: "$OBSERVATIONS" },
    { $match: { "OBSERVATIONS.DESCRIPTION": "Body mass index (BMI)" } },
    { $project: { _id: 0, date: "$OBSERVATIONS.DATE" } }
])

db.patients.aggregate([
    { $match: { "PROCEDURES.DESCRIPTION": "Depression screening using Patient Health Questionnaire Nine Item score (procedure)" } },
    { $unwind: "$PROCEDURES" },
    { $match: { "PROCEDURES.DESCRIPTION": "Depression screening using Patient Health Questionnaire Nine Item score (procedure)" } },
    { $project: { _id: 0, FIRST: 1, LAST: 1 } }
])
